// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IMetadataManager.sol";
import "./interfaces/IYieldToken.sol";

contract RisingSkullsNFT is Ownable, AccessControl, ERC721Enumerable {
	bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

	modifier onlyMinter() {
		require(hasRole(MINTER_ROLE, _msgSender()), "AccessControl: caller is not the minter");
		_;
	}

	struct Skull {
		uint256 genes; // Used for ressurection. When genes = 0 the ressurected skull is in an incubation state.
		uint256 bornAt;
		uint256 rarity; // Rarity rank (1 - 4000). 1 = most rare, 4000 = least rare. Only applies to OG skulls.
	}

	mapping(uint256 => Skull) public skulls;
	// Owner address => token IDs. Stores ownerships of genesis skulls (ID 1-4000).
	mapping(address => uint256) public balanceOG;
	bool public rewardsActive;

	IYieldToken public yieldToken;
	// Metadata manager manages skull naming, bio and stats.
	IMetadataManager public metadataManager;

	event SkullIncubated(uint256 tokenId, uint256 matron, uint256 sire);
	event SkullBorn(uint256 tokenId, uint256 genes);

	constructor(string memory _name, string memory _symbol) public ERC721(_name, _symbol) {
		// Contract owner is both minter and access control admin.
		_setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
		_setupRole(MINTER_ROLE, _msgSender());
		rewardsActive = false;
	}

	function mint(address to, uint256 genes, uint256 rarity) external onlyMinter returns (uint256) {
		uint256 id = totalSupply() + 1;
		skulls[id] = Skull(genes, block.timestamp, rarity);

		_mint(to, id);

		if (id <= 4000) {
			balanceOG[to]++;
		}
		return id;
	}

	function tokenURI(uint256 _tokenId) public view virtual override returns (string memory) {
		require(_exists(_tokenId), "ERC721Metadata: URI query for nonexistent token");
		return metadataManager.tokenURI(_tokenId);
	}

	function getGenes(uint256 _tokenId) external view returns (uint256) {
		return skulls[_tokenId].genes;
	}

	function setGenes(uint256 _tokenId, uint256 _genes) external onlyMinter {
		Skull storage skull = skulls[_tokenId];
		skull.genes = _genes;
	}

	function setRarity(uint256 _tokenId, uint256 _rarity) external onlyMinter {
		Skull storage skull = skulls[_tokenId];
		skull.rarity = _rarity;
	}

	function getRarity(uint256 _tokenId) external view returns (uint256) {
		return skulls[_tokenId].rarity;
	}

	function getReward() external {
		require(rewardsActive == true, "Rewards aren't active");
		yieldToken.updateReward(msg.sender, address(0), 0);
		yieldToken.getReward(msg.sender);
	}

	function transferFrom(address from, address to, uint256 tokenId) public override {
		yieldToken.updateReward(from, to, tokenId);
		if (tokenId <= 4000)
		{
			balanceOG[from]--;
			balanceOG[to]++;
		}
		ERC721.transferFrom(from, to, tokenId);
	}

	function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public override {
		yieldToken.updateReward(from, to, tokenId);
		if (tokenId <= 4000)
		{
			balanceOG[from]--;
			balanceOG[to]++;
		}
		ERC721.safeTransferFrom(from, to, tokenId, _data);
	}

	function supportsInterface(bytes4 interfaceId) public view virtual override(AccessControl, ERC721Enumerable) returns (bool) {
		return super.supportsInterface(interfaceId);
	}

	/*
	* OWNER FUNCTIONS
	*/
	function setRewardsActive(bool _state) public onlyOwner {
		rewardsActive = _state;
	}

	function setYieldToken(address _yield) external onlyOwner {
		yieldToken = IYieldToken(_yield);
	}

	function setMetadataManager(address _manager) external onlyOwner {
		metadataManager = IMetadataManager(_manager);
	}

	/**
	 * @dev Remember that only owner can call so be careful when use on contracts generated from other contracts.
	 * @param _tokenAddress The token contract address
	 * @param _tokenAmount Number of tokens to be sent
	 */
	function recoverERC20(address _tokenAddress, uint256 _tokenAmount) public onlyOwner {
		IERC20(_tokenAddress).transfer(owner(), _tokenAmount);
	}
}

